import React from 'react'
import {LoginForm, Register}  from '../components'

const Auth = ({authRoute}) => {

  let body
  body = (
    <>
      Learit
      {authRoute === 'login' && <LoginForm/>}
      {authRoute === 'register' && <Register/>}
    </>
  )
  return (
    <div className='landing'>
      <div c></div>
    </div>
  )
}
export default Auth
